(window.webpackJsonp=window.webpackJsonp||[]).push([[372],{1e3:function(n,e){n.exports="\x3c!--\ntitle: Fiddler抓包\nsort:\n--\x3e\n\n## Fiddler 基础\n\n| 功能         | 介绍                           |\n| ------------ | ------------------------------ |\n| Statistics   | 统计信息，可多选               |\n| Inspectors   | 检查，多种方式查看请求响应报文 |\n| AutoResponse | 自动响应，修改服务端返回的数据 |\n| Composer     | 构造，修改请求后发送至服务端   |\n| Filters      | 过滤器，对于数据流进行过滤     |\n\n### 快捷键\n\n- R 键：重放请求（R 包）\n- Shift+R：多次重放\n- Ctrl+X：删除全部\n\n### QuickExec\n\n| 命令      | 功能                           |\n| --------- | ------------------------------ |\n| cls       | 清空请求列表                   |\n| select    | 选择对应类型<br />select image |\n| `?<text>` | 含有关键词的高亮               |\n| `>size`   | 根据大小查找 size              |\n| bpu xxx   | 响应前根据关键词设置断点       |\n| bpa xxx   | 响应后根据关键词设置断点       |\n| bps 404   | 中断 404 状态码                |\n| bpv get   | 中断 get 请求                  |\n\n## 手机抓包\n\n1. 设置代理到电脑的 8888 端口\n2. Fiddler 的 Connection 打开允许所有\n3. 手机访问电脑 ip 及端口，安装 CA 证书\n"}}]);